import React from "react";
import PropTypes from "prop-types";

function Item({ todo, index, change }) {
  console.log(todo);
  const styles = {
    li: {
      display: "flex",
      alignItems: "center",
      padding: "10px 20px",
      border: "1px solid #545454",
      borderRadius: "4px",
      cursor: "pointer",
      gap: "15px",
    },
    button: {
      width: "30px",
      height: "30px",
    },
  };
  return (
    <li style={styles.li}>
      <input type="checkbox" onChange={() => change(todo.id)}></input>
      <span style={styles.span}>
        <strong>{index + 1}. </strong>
        {todo.title}
      </span>
      <button style={styles.button}>&times;</button>
    </li>
  );
}

Item.propTypes = {
  todo: PropTypes.object.isRequired,
  index: PropTypes.number,
  change: PropTypes.func.isRequired,
};

export default Item;
